(9, 'Bmw', '118', 'gasoline', 1599, 8000, 2009, 'hatchback', '[\"1581497490\\/9f92118750075dfd789121d3a7278fb8.jpeg\",\"1581497490\\/0347b68302fcc2535bd942f811158949.jpeg\",\"1581497490\\/dbf090d1d0ed49cebc528a31a6acfda2.jpeg\",\"1581497490\\/b1e97f6be622b41fce9ed89b095d8e11.jpeg\",\"1581497490\\/42989e8aa5821700bbf95a6f10a4a56e.jpeg\",\"1581497490\\/13cd996de1b56b4c375c5c088d67a222.jpeg\",\"1581497490\\/105734ecd0ce16119e9ad7b4fa11d927.jpeg\",\"1581497490\\/812d228ddd574263d7e6a8b9d88e4d02.jpeg\",\"1581497490\\/03353f28f2834a652d3d036ee9e3b103.jpeg\",\"1581497490\\/23ddd5c485bac9be4d54d2b1a8c7badd.jpeg\",\"1581497490\\/c5c8a3f2867c90860bc8171a10aa4ecd.jpeg\"]', '[\"Air Condition\",\"Alloy wheels\",\"ABS\"]', 'Naglašavamo da automobil ima prednju vuču i prodaje sa 8 aluminijumskih točkova sa gumama za leto i zimu.\r\nOd velikog paketa opreme izdvajamo:\r\n\r\nProfessional navigacija\r\nHead up display\r\nDVD/TV\r\nAutomatsko sklapanje retrovizora\r\nElektrohrom retrovizori sa automatskim zatamnjenjem\r\nGrejanje sedišta\r\nSistem zaštite pešaka\r\nPark assistent - pomoć pri parkiranju\r\nLed svetla\r\nStart stop\r\n\r\n***GARANTUJEMO***\r\n\r\n• Tehničku ispravnost\r\n\r\n• Legalnost vozila u zemlji i inostranstvu\r\n\r\n• Originalnost propratne dokumentacije\r\n\r\n\r\n***OPIS***\r\n\r\nUVEZEN IZ NEMAČKE\r\n\r\n• Redovno održavan u ovlašćenim servisima.\r\n• Kupcu na uvid SGS izvestaj koji detaljno svedoci o stanju vozila prilikom kupovine od leasing kuce.\r\n\r\n\r\n\r\n\r\n***OSTALE POGODNOSTI***\r\n\r\n• Carina i pdv su plaćeni, vozilo se registruje na ime kupca\r\n\r\n• Na vozilu je izvršen pregled AMSS i plaćeni su svi troškovi, Vama ostaje samo registracija\r\n\r\n• Kompletna usluga registracije vozila od tehničkog pregleda do odlaska u SUP\r\n\r\n• Kompletna organizacija i pomoć pri vađenju probnih tablica\r\n\r\n• Mogućnost provere vozila u ovlašćenom ili servisu po Vašem izboru', '4/5', '2', '', '5 shift manual', 40000, '116d', 69, '', '03/2020', 'euro4', 'fwd', '[\"Alarm\",\"Airbags\",\"ABS\",\"Esp\"]', 5, 'manual'),
(10, 'Peugeot', '207', 'gasoline', 1400, 4000, 2010, 'hatchback', '[\"1581500529\\/eb6a7807764ab956e2c8e68f25b3575b.jpeg\",\"1581500529\\/1c43861accfb5e153ba6fc48de4c9bb4.jpeg\",\"1581500529\\/457f9c4cc325d1f17b57962fd9d16848.jpeg\",\"1581500529\\/8482b83d111435dbdaf116cee03c4627.jpeg\",\"1581500529\\/742e8637f8b37d58c9c9a9755ac25b99.jpeg\",\"1581500529\\/a8bd86d2ca229fc6d30a23bc2e7c77c6.jpeg\",\"1581500529\\/b6ffbab329325fc05fca34265cdc26b8.jpeg\",\"1581500529\\/fb64782a397336433011bfac758f61da.jpeg\",\"1581500529\\/a9c89884833a3837aedef95f30e7cd40.jpeg\",\"1581500529\\/c90f4c1b7f8001b332d9566a8de1fb5d.jpeg\",\"1581500529\\/e544ce5bc4811414e893ef6c953e0967.jpeg\",\"1581500529\\/2e7770227cde17be79940d67165fb015.jpeg\"]', '[\"Air Condition\",\"Alloy wheels\",\"ABS\"]', 'Vozilo iz uvoza sa kompletnom dokumentacijom za registraciju na ime kupca.\r\nVozilo je u odličnom stanju,bez daljih ulaganja,odličan paket opreme sa FABRIČKOM NAVIGACIJOM,kamerom za vožnju u rikverc,park senzorima,tempomatom,hands free uređajem za bežično telefoniranje,smart kee ulazak bez ključa i paljenje bez ključa,digitalna klima,crno nebo,led dnevna svetla,...\r\nDatum prve registracije je 28.05.2015 a godina proizvodnje je 2014 .\r\nZADNJA KLUPA JE SA 3 ODVOJENA SEDIŠTA KOJA SE SVAKO ZA SEBE POSEBNO POMERA I PODEŠAVA KAO PREDNJA,tako da možete podedšavati prtljažni prostor po potrebi.\r\nU zamenu dolazi u obzir vozilo do 2 000 ccm i 50 % vrednosti našeg.', '4/5', '2', '', '5 shift manual', 60000, 'PopStar', 145, '', '03/2020', 'euro4', 'fwd', '[\"Alarm\",\"Airbags\",\"ABS\",\"Esp\"]', 5, 'manual'),
(14, 'Ford', 'S-MAX', 'hybrid', 1500, 12000, 2010, 'estate', '[\"1581504567\\/67844c540d7eaa0d718795c31f68e7af.jpeg\",\"1581504567\\/60b79341575f4bac26175b3271c0e69a.jpeg\",\"1581504567\\/9ded5a76a6f3003007c69946fd7564ba.jpeg\",\"1581504567\\/3a4559a092a4d2bafbe90c7f96b5f913.jpeg\",\"1581504567\\/e7860e97802472a3ebd8a45c18bb09d4.jpeg\",\"1581504567\\/a258e242c53cb97a481939b39730811b.jpeg\",\"1581504567\\/80846b5c807df7ec274c78da482ca95f.jpeg\",\"1581504567\\/f7c86cd0a641499a8886ed9946866436.jpeg\",\"1581504567\\/861f7281991927bd10129cf636f9e082.jpeg\",\"1581504567\\/66134355d163a7f8f719778d13d0a316.jpeg\",\"1581504567\\/7f7c5c25a01b43a32f89381c2a03b444.jpeg\",\"1581504567\\/9a74426ba8cfc574d231e0e64881c4ec.jpeg\",\"1581504567\\/2238d5538872bbd7b66ae4ebe612e316.jpeg\"]', '[\"Air Condition\",\"Alloy wheels\",\"ABS\",\"Isofix\",\"Alarm\",\"Sunroof\"]', '*Vozilo je u odlicnom stanju.\r\n\r\n*Redovno servisiran u ovlascenom servisu bez dodatnih ulaganja.\r\n\r\n*Direktna kupovina od partnera iz Francuske, zagarantovano poreklo, kilometraza, na uvid kompletna istorija odrzavanja i fotografije vozila u trenutku kupovine.\r\n\r\n*Detaljan pregled vozila uradjen u nasem servisu po dolasku vozila u Srbiju.\r\n\r\n*Trend + paket opreme: kožni multifunkcionalni volan sa grejanjem volana, navigacija, dnevna svetla, hands free kljuc, elektricni podizaci, parking senzori sa grafickim prikazom napred i pozadi, tempomat, grejanje sedista, multimedija, start stop i jos dosta toga....\r\n\r\n*cena sa placenim porezom na prenos apsolutnih prava (na ime kupca).\r\n\r\n\r\n*** AUTOLAND-POSEBNA PONUDA FINANSIRANJA ***\r\n\r\n\r\n*** ZAKUP VOZILA ---AKCIJA DAJ 999EUR I VOZI: Depozit 999eura, period zakupa od 24 do 48 meseci. Podnošenje zahteva, odobrenje, potpisivanje,registracija i preuzimanje vozila na licu mesta !!!\r\nPonuda važi za fizička lica, pravna lica i preduzetnike.\r\n\r\n\r\n*** FINANSIJSKI LIZING: 25% učešće, 3.49% nominalna FIKSNA kamatna stopa. Ponuda važi za fizička lica, pravna lica i preduzetnike.\r\n\r\n\r\n*** BESKAMATNO finansiranje: 0% kamata, 0% troskovi obrade kredita*** -podnosenje zahteva i odobrenje na licu mesta, bez odlaska u banku. Period finansiranja do 36 meseci, iznos kredita od 1.000 do 5.000 eura u zavisnosti od vozila (informisite se kod prodavca za detalje ). Ponuda važi za fizička lica.\r\n\r\n\r\n***EURSKI kredit sa fiksnom kamatnom stopom od 4,50% sa periodom otplate do 84 meseci, minimalnim ucescem od 30% I troškom obrade kredita od 2,95% uključenim kroz mesečne rate. Podnosenje zahteva i odobrenje na licu mesta, bez odlaska u banku. Ponuda važi za fizička lica.\r\n\r\n\r\n***DINARSKI kredit 0% učešća, do 84 meseca period otplate, sa fiksnom kamatom 7.45% u dinarima I trošak obrade kredita 2.95% ukljucen kroz ratu. Podnosenje zahteva i odobrenje na licu mesta, bez odlaska u banku. Ponuda važi za fizička lica.\r\n\r\n***Kompletnu ponudu možete pogledati i na našem sajtu http://autoland.akkompresor.rs ***\r\n\r\nSva vozila su kupljena u Srbiji, prilikom otkupa detaljno pregledana u servisu .\r\nVozila poseduju kompletnu dokumentaciju, uredne servisne istorije I proverene kilometraže.\r\n\r\n\r\n***PISANA GARANCIJA OD GODINU DANA ILI 10000KM (na motor bez pratećih agregata) ZA SVA NAŠA VOZILA***\r\n\r\nHvala Vam na pregledu oglasa.\r\n\r\n*Kompresor Autoland doo se trudi da pruži maksimalnu tačnost informacija i podataka, s tim da se u potpunosti odriče bilo kakve odgovornosti za tačnost i/ili potpunost svih informacija/opreme jer su moguće nenamerne različitosti stvarnog proizvoda i opisanog na ovim stranicama.', '4/5', '3', '1581504567', '5 shift manual', 200000, 'Family', 145, '', '03/2020', 'euro4', 'fwd', '[\"Alarm\",\"Airbags\",\"ABS\",\"Esp\"]', 5, 'manual'),
