(21, 'Alfa Romeo', '159', 'diesel', 1995, 8900, 2008, 'limousine', '[\"1582013637\\/0f305781193a04313b85375f9feaa95e.jpeg\",\"1582013637\\/c40e6521c6ea7292d8a602c1cc68b8ea.jpeg\",\"1582013637\\/1d3c1fd5511fdb43c0067f6e565c62f4.jpeg\",\"1582013637\\/7e37f4b6e2e12fa63be1e5432e5d5ea1.jpeg\",\"1582013637\\/63996fdf0ab7392f6e2613dcde104dcc.jpeg\",\"1582013637\\/552ab7d7b17dbf9aea5cc1f26f1c3e3f.jpeg\",\"1582013637\\/149343550631b27f92f53e28c552b6f5.jpeg\",\"1582013637\\/c11d469ffdcec17877c9c112657f46c5.jpeg\",\"1582013637\\/9db8dd87436903dcfe35103c3e013625.jpeg\",\"1582013637\\/37cfcf082e1813e05bfb5294f2e021d9.jpeg\",\"1582013637\\/f9069a403becf9bc149fc8da7825f7b6.jpeg\",\"1582013637\\/b33b3b367cba224dd6c99e6d8c07166f.jpeg\"]', '[\"Air Condition\",\"Alloy wheels\",\"ABS\",\"Isofix\"]', 'Auto kupljen iz uvoza 2013, i od tada je u mom vlasništvu. Što se tiče mehanike auto je odličan, bez ulaganja (kupljeni su zadnji diskovi i pločice koji će biti zamenjeni ovih dana). Limarijski, na mestima su vidljive ogrebotine i manja oštećena, sve od gradske vožnje (vidite slike). Auto redovno održavan, poslednji veliki servis rađen na 200.000, a mali na 223.000 km. Na autu je zamenjen plivajući zamajac, stavljen original LUK-ov (1.000 EUR), što znači da ne treba da brinete i strepite o najskupljoj popravci. U poslednjih 7 godina, ne uzimajući u obzir potrošne delove, zamenjen je još samo EGR ventil.\r\n\r\nUz auto još dolaze poprečni nosači koji su na slikama i letnje gume (Tigar UHP).\r\n\r\nZa više informacija nazovite.', '4/5', '1', '1582013637', '5 shift manual', 140000, '2.0 jtd', 100, '', 'without', 'euro4', 'fwd', '[\"Alarm\",\"Airbags\",\"ABS\",\"Esp\"]', 5, 'automatic'),
(22, 'Alfa Romeo', '159', 'diesel', 1595, 5600, 2009, 'limousine', '[\"1582013721\\/8feb9d1b3522cbfbd1b5c6c7f6aeb861.jpeg\",\"1582013721\\/29df2b8e80094e54c84313e16a39c1f1.jpeg\",\"1582013721\\/b9bc19e907b5e2226c1c3304a83e5346.jpeg\",\"1582013721\\/8d80aa12b0559ca031389254bd129995.jpeg\",\"1582013721\\/35a7dfc5c38c3b1768da0fdfc9f75c4a.jpeg\",\"1582013721\\/892e029b4607bb45723c4c02c5a18371.jpeg\",\"1582013721\\/fe33ab0f7935582880332e3f0264a54c.jpeg\",\"1582013721\\/e7ad807a4b6e65be78b2513136f0c747.jpeg\",\"1582013721\\/1445e177fb8e1f98a975319d820b8877.jpeg\",\"1582013721\\/67ba98d47af41519f4e67903b40a8f0e.jpeg\",\"1582013721\\/cc4de517bfb5372b0f76c90459ee30e8.jpeg\",\"1582013721\\/9041a2273426457efb8d9e646606a269.jpeg\",\"1582013721\\/cdc4a2c20c3ac1a0d6e45aff990b7937.jpeg\"]', '[\"Air Condition\",\"Alloy wheels\",\"ABS\",\"Isofix\",\"Alarm\"]', 'ALFA 159 2.0jtdM 170ks 2011god.-NAJNOVIJI MOTOR ZADNJE GENERACIJE-ODLIČNO STANJE .....GUME SVE 4 ODLIČNE....NOV AKUMULATOR.....MOTOR,TRAP I MENJAČ U ODLIČNOM STANJU......POSEDUJEM SLIKE PRI KUPOVINI U ITALIJI....2 KLJUČA.....CENA JE VEĆ SPUŠTENA I FIXNA !!!!!', '4/5', '1', '1582013721', '5 shift manual', 160000, '1.6 Multijet', 136, '', 'without', 'euro4', 'fwd', '[\"Alarm\",\"Airbags\",\"ABS\",\"Esp\"]', 5, 'manual'),
(23, 'Alfa Romeo', '159', 'gasoline', 2995, 4400, 2010, 'estate', '[\"1582013879\\/a1ce27debf48cb4b646b44a301c62fb1.jpeg\",\"1582013879\\/4d008cbae1fff6e84c1f1bf2d92a203c.jpeg\",\"1582013879\\/4d47fad1b86a37d266eb98e315f11be9.jpeg\",\"1582013879\\/7863afc720443716a1c57b32ce32e2d3.jpeg\",\"1582013879\\/6b97cb7800970dc6255d069badc70c7a.jpeg\",\"1582013879\\/25f4a23f3a2bc1a14a3554c2972df128.jpeg\",\"1582013879\\/78369dcd7eaf7ac8bc3dfe03157c215f.jpeg\",\"1582013879\\/7a1b70e1103ac2fb4b6b464315031b4a.jpeg\",\"1582013879\\/7d1bf1b6a79709b19ffb6d7831535982.jpeg\",\"1582013879\\/446a2616c9f47ed7dad2309b3debd56e.jpeg\",\"1582013879\\/0a20a51c0e14cf3364db7db11079e290.jpeg\"]', '[\"Air Condition\",\"Alloy wheels\",\"ABS\",\"Isofix\",\"Alarm\"]', 'Alfa je korišćena u porodične svrhe, uglavnom za duža putovanja i maksimalno se vodilo računa o održavanju.U prilog tome ide i servisna knjižica, sva prateća dokumentacija, kao i posedovanje dva originalna ključa u funkciji.\r\n*Na 192350 km je kompletno pregledan auto: trap, kočnice, grejači, upravljački deo i tom prilikom uradjen je mali servis (svi filteri sa uljem) i kupljene su dve nove letnje gume za 16\" aluminijumske felne.Prilikom paljenja i gašenja ne čuje se zamajac i menjač savršeno radi.Budući vlasnik nema dodatnih ulaganja, jer do sledećeg servisa ima još 6000 km.\r\n*Pored standardne opreme (digitalne klime, ASP, ASR, Tempomata, el.podizača za sva stakla...), alfa ima i krovne nosače, fabričke parking senzore, hilholder(pomoc pri kretanju uzbrdo), prednje i zadnje maglenke, Usb priključak za slušanje muzike koji je povezan sa MP3 muzikom i Mf volanom, rashladnu pregradu ispod naslona za ruku, led osvetljenje table, kao i originalne Alfine patosnice.Unutrašnjost je maksimalno sačuvana, nepušački auto, svako dugme je u funkciji.\r\n*Sve u svemu odlično očuvan auto, atraktivne boje, za prave ljubitelje ovoga Italijanskoga modela.\r\nPrenos je obavezan.Srećna kupovina!', '4/5', '1', '1582013879', '5 shift manual', 202000, 'Twin-Spark', 121, '', '03/2020', 'euro4', 'fwd', '[\"Alarm\",\"Airbags\",\"ABS\",\"Esp\"]', 5, 'manual'),
(24, 'Peugeot', '308', 'diesel', 1595, 3999, 2011, 'estate', '[\"1582014014\\/256ea951c23e2d8c5aace3873e4af38a.jpeg\",\"1582014014\\/0e2efe3045365888846006d0f2da1a5d.jpeg\",\"1582014014\\/012ed570a567e58de8825f6e1e039f44.jpeg\",\"1582014014\\/f482461b70840eee5a0bf565cc7b2424.jpeg\",\"1582014014\\/e74f674977f749afead7820bc81c7e6a.jpeg\",\"1582014014\\/6eca77a56bdf1dd972e5e6b9173b23c2.jpeg\",\"1582014014\\/36ccb56bcd07e712e78d0381a54c3805.jpeg\",\"1582014014\\/9fb794921d5cc419bce15f4d5984017d.jpeg\",\"1582014014\\/8527a2de9501e03991eeb6d986177e3d.jpeg\",\"1582014014\\/bedd42d01a083e87314193680e8c1806.jpeg\",\"1582014014\\/c03dcf4f010a282a9a774abcd5f219af.jpeg\"]', '[\"Air Condition\",\"Alloy wheels\",\"ABS\",\"Isofix\",\"Alarm\",\"Sunroof\"]', '*** Peugeot 308 1.6 blue HDi je u besprekornom stanju u svim segmentima !!! ***\r\n\r\n** Vozilo je uvezeno iz Nemačke.\r\n\r\n** Prodaje se na ime kupca, svi troskovi su placeni tako da kupcu ostaje samo registracija.\r\n\r\n** Ocarinjen na 146285km originalnih km.\r\n\r\n** 22.07.2014. datum prve registracije.\r\n\r\n** Datum proizvodnje 2014.godina, model za 2015.godinu!\r\n\r\n** Euro 6 norma\r\n\r\n** 2 kljuca\r\n\r\n** Odlican paket opreme\r\n~Navigacija sa mapama Srbije i ostatka evrope\r\n~Parkign senzori napred i pozadi\r\n~Led dioda napred i pozadi\r\n~Panorama\r\n~4x el.podizaci stakala\r\n~Tempmat\r\n~Mf.kozni volan\r\nitd\r\n\r\n** Izuzetno mali potrosac 5.1l/100km GRAD!!!\r\n\r\n** VOZILO JE APSOLUTNO ZA SVAKU PREPORUKU!\r\n\r\n** Za kupce iz Novog Sada pruzamo uslugu registracije vozila, a za kupce izvan Novog Sada obezbedjujemo probne tablice.\r\n\r\n** Za vise informacija pozovite eVerest AUTOMOBILE\r\n\r\n// Kontakt podaci //\r\n\r\neVerest Automobili\r\n\r\nGenerala Vasica 30\r\nVeternik - Novi Sad', '4/5', '1', '1582014014', '6 shift manual', 120000, '1.6HDi', 105, '', '03/2020', 'euro4', 'fwd', '[\"Alarm\",\"Airbags\",\"ABS\",\"Esp\"]', 5, 'manual'),
(25, 'Peugeot', '308', 'diesel', 1995, 3998, 2013, 'hatchback', '[\"1582014100\\/816e73bc543a56e7f13617c1061173e9.jpeg\",\"1582014100\\/71a9ae11b51c77f51d6f09a72c9aee8a.jpeg\",\"1582014100\\/8d23d25d912837712c11dda42ab19936.jpeg\",\"1582014100\\/90f3c794ca567befff7737c851f1afbe.jpeg\",\"1582014100\\/ee706a0401354ea4b64c2a55f0038a29.jpeg\",\"1582014100\\/b65860e28bbe4d4d6113259b1f1e662a.jpeg\",\"1582014100\\/9d48967e4fa3155d48f77a61aab64185.jpeg\",\"1582014100\\/2717135e1cf03976d7daaca5b114a7fb.jpeg\",\"1582014100\\/8c307f68e674792ee1b9a4796f66872c.jpeg\",\"1582014100\\/104b5a0892b5176da9f7d42a8e83c568.jpeg\",\"1582014100\\/3cea022dd960ea327c589347579bb40d.jpeg\",\"1582014100\\/d84b9747c00e11be839552c7ff84a4b1.jpeg\"]', '[\"Air Condition\",\"Alloy wheels\",\"ABS\",\"Isofix\",\"Sunroof\"]', 'Auto u besprekornom stanju, bez ikakvih ostecenja ili bilo kakvih dodatnih ulaganja. Motor 1.6HDI sa 90ks i BEZ PLIVAJUCEG ZAMAJCA. Jako mali potrosac sa svega 5.5l gradske voznje. Busines paket opreme;\r\n- panorama krov\r\n- tonirana stakla\r\n- led dnevna svetla\r\n- gps - navigacija- usb- aux- sd\r\n- mape cele evrope i Srbije\r\n- hill holder kotrol\r\n- digitalna dvozonska klima\r\n- el retrovizori, podizaci\r\n- bluetooth\r\n- touch screen monitor\r\n- parking senzori sa vizuelizacijom prepreka\r\nI jos dosta opreme. Carina, porez i AMS sve zavrseno kupcu ostaje samo registracija. U istom danu kupcu obezbedjujemo svu potrebnu dokumentaciju za registraciju vozila i proba table.', '4/5', '1', '1582014100', '5 shift manual', 132222, '20hdi', 140, '', 'without', 'euro4', 'fwd', '[\"Alarm\",\"Airbags\",\"ABS\",\"Esp\"]', 5, 'automatic'),
(26, 'Peugeot', '308', 'diesel', 1995, 5600, 2012, 'hatchback', '[\"1582014170\\/6cbbc3c506d6a1801827618c7cd1e24c.jpeg\",\"1582014170\\/9e17ea4a1ed27e763ba050ffc2550c1c.jpeg\",\"1582014170\\/b1c71ba399cb6b355bc1dd3d1df1e667.jpeg\",\"1582014170\\/dff7fcce31f1d06c33ca6f9de35d6d20.jpeg\",\"1582014170\\/6d3340b54ed6d48f6e91f64a42b81ef6.jpeg\",\"1582014170\\/21fa0628a3439014ee1cb3ad6ccb80f1.jpeg\",\"1582014170\\/056582939a14b7b03d589bc7a6c0d294.jpeg\",\"1582014170\\/ca925cc9431c255d589a972efb1c38d8.jpeg\",\"1582014170\\/905323df6c8ba8d954f941b254550cc8.jpeg\",\"1582014170\\/e4d92e15f01e8e0952422515599f17a8.jpeg\"]', '[\"Air Condition\",\"Alloy wheels\",\"ABS\",\"Isofix\",\"Alarm\",\"Sunroof\"]', 'Auto uvežen iz Belgije,urađen mali i veliki servis, potpuno ispravan, dva seta dobrih guma apsolutno bez ikakvih ulaganja.', '4/5', '1', '1582014170', 'automatic', 129995, '2.0HDI', 140, '', '03/2020', 'euro4', 'fwd', '[\"Alarm\",\"Airbags\",\"ABS\",\"Esp\"]', 5, 'manual'),
(27, 'Opel', 'Astra', 'gasoline', 1599, 7000, 2013, 'estate', '[\"1582108451\\/59d8b323555e31f77e1a4bdb854f100b.jpeg\",\"1582108451\\/e9de421958093f050af4a6cfb3172764.jpeg\",\"1582108451\\/305da63262c0ad3ff119671ff0dd5c90.jpeg\",\"1582108451\\/198e568857482ac6f841db1a7cd07d3c.jpeg\",\"1582108451\\/24b8c73e275d548f3abce56a16c65b25.jpeg\"]', '[\"Air Condition\",\"Alloy wheels\",\"ABS\",\"Isofix\",\"Alarm\",\"Sunroof\"]', 'Vozilo je iz uvoza , placeni su svi troskovi tako da kupcu ostaje registracija .\r\nVozilo je u prvoj ( fabrickoj ) boji , bez ikakvih ostecenja .\r\nBoja vozila je jedinstvena , nijanse se prelamaju na suncu .\r\nEnterijer vozila je kao nov , cosmo .\r\n* na vozilu je uradjen mali servis ( naredni za 15000 km ) .\r\n* veliki servis ( naredni za 80000 km )\r\n* zamenjen je lanac sa setom ( naredna zamena izmedju 150000-200000km )\r\nSvi ugradjeni delovi su iz orginala .\r\nUradjena je kontrola ostalog .\r\nStavljene su nove , zimske gume .\r\nTako da na vozilu nema apsolutno nikakvog dodatnog ulaganja .\r\nMogucnost prevoza vozila na adresu kupca .\r\nMogucnost izdavanja probnih tablica u najkracem roku .\r\nMogucnost prodaje vozila na rate bez kamate .\r\nZa vise informacija nas kontaktirajte', '4/5', '1', '1582014468', '5 shift manual', 99000, '1.6', 250, '', 'without', 'euro4', 'fwd', '[\"Alarm\",\"Airbags\",\"ABS\",\"Esp\"]', 5, 'manual'),
(31, 'Opel', 'Insignia', 'diesel', 1595, 7400, 2010, 'limousine', '[\"1582100476\\/53d8a5b8efbfa5c1da492e412f0e46b7.jpeg\",\"1582100476\\/ea971763d2d436bf900eee1e8eb15084.jpeg\",\"1582100476\\/2129bf6edf649609d71a396564522e14.jpeg\",\"1582100476\\/6a1df9ed36b3037921c7d5aed659812c.jpeg\",\"1582100476\\/311b42f16db729038d781a1d0423f83a.jpeg\",\"1582100476\\/f5f4691de75f849dca2e13297aeb71b1.jpeg\",\"1582100476\\/8e160f4d0937706de8fc2b8c278e1a5e.jpeg\",\"1582100476\\/da11fa63cfc4d9beee96e1f036c9832d.jpeg\"]', '[\"Air Condition\",\"Alloy wheels\",\"ABS\",\"Isofix\",\"Alarm\"]', 'SAMO 176290 KILOMETARA SA DVA KODIRANA KLJUCA, SERVISNOM KNJIZICOM I KOMPLETNOM\r\nDOKUMENTACIJOM ODRZAVAN I SERVISIRAN U VOLKSVAGENOVOM PREDSTAVNISTVU U SVAJCARSKOJ...\r\n\r\nNA AUTU SVE BESPREKORNO FUNKCIONISE, BEZ IKAKVIH HAVARIJA, OGREBOTINA I ULAGANJA, BUKVALNO JE KAO NOV...\r\n\r\nAUTOMATSKA KLIMA, TEMPOMAT, RADIO CD FABRICKI, ALUMINIJUMNSKE FELNE I JOS MNOGO TOGA...\r\n\r\n103 KW - 140 PS - 6 BRZINA MANUELNI\r\n\r\nAUTO JE OCARINJENO, PLACEN PDV I POSEDUJE UVERENJE IZ AMSS...\r\nPLACENI SU SVI TROSKOVI CARINE + PDV + AMSS...\r\nKUPCU PREOSTAJE SAMO REGISTRACIJA BEZ IKAKVIH DODATNIH TROSKOVA...\r\n\r\nSVAKA PREPORUKA ZA OVAJ AUTO...\r\n\r\nGARANTOVANA LEGALNOST AUTA I MOGUCA JE SVAKA VRSTA PROVERE...\r\n\r\nSVA NASA AUTA U PONUDI DOVEZENA SU LICNO I NA TOCKOVIMA...\r\n\r\nMEHANICKI I OPTICKI JE U TOP STANJU...\r\n\r\nPRI KUPOVINI AUTO KOD NAS PREVOZ DO 100 KILOMETARA JE O NASEM TROSKU...\r\n\r\nVRSIMO USLUZNI PREVOZ AUTOMOBILA IZ SVAJCARSKE DO BILO KOG GRADA U SRBIJI SA NASOM CARINOM I AMSS ILI VASOM CARINOM, SVE PO VASOJ ZELJI...\r\nBRZO, EFIKASNO, POVOLJNO....', '4/5', '2', '1582100476', '5 shift manual', 155000, '1.6 ecotech', 87, '', '07/2020', 'euro4', 'fwd', '[\"Alarm\",\"Airbags\",\"ABS\",\"Esp\"]', 5, 'manual'),
