(43, 'Opel', 'Astra', 'diesel', 1598, 6850, 2015, 'estate', '[\"1582707275\\/76e0f00528ad78e08ac771fe1d7fbe76.jpeg\",\"1582707275\\/d4b0a785473f82c35b2d1967e18e5316.jpeg\",\"1582707275\\/1a999d41fc625ac8bd5c387018764eb1.jpeg\",\"1582707275\\/c8dad5c71ab06c3fa036fbb9ad9ee0a7.jpeg\",\"1582707275\\/184384dfd38287d4e5b5b905abebeaba.jpeg\",\"1582707275\\/dd1eac393735f87181f751f19d16768b.jpeg\",\"1582707275\\/f6a2ec2559efd333059cccd19028036f.jpeg\",\"1582707275\\/7fb2d17d33408cb0ad8dbb9e190a8ffd.jpeg\",\"1582707275\\/137e743e0845c4e488522f7dc3ff76f5.jpeg\",\"1582707275\\/78180c76bab65d8153fa4fda8b97fdcc.jpeg\",\"1582707275\\/51ce604daa9f35bd7803c0b093465c82.jpeg\",\"1582707275\\/98bd19fb3fb7c80d268b512f1ebd41cb.jpeg\",\"1582707275\\/c50a09df05e144eb498600375b15a707.jpeg\",\"1582707275\\/546270cea8db4d7222d4acb3312e3174.jpeg\"]', '[\"Alloy wheels\",\"Navigation\",\"Radio\",\"Sunroof\",\"Usb\",\"Board computer\",\"Isofix\"]', 'Vozilo je iz uvoza , placeni su svi troskovi tako da kupcu ostaje registracija .\r\nVozilo je u prvoj ( fabrickoj ) boji , bez ikakvih ostecenja .\r\nBoja vozila je jedinstvena , nijanse se prelamaju na suncu .\r\nEnterijer vozila je kao nov , cosmo .\r\n* na vozilu je uradjen mali servis ( naredni za 15000 km ) .\r\n* veliki servis ( naredni za 80000 km )\r\n* zamenjen je lanac sa setom ( naredna zamena izmedju 150000-200000km )\r\nSvi ugradjeni delovi su iz orginala .\r\nUradjena je kontrola ostalog .\r\nStavljene su nove , zimske gume .\r\nTako da na vozilu nema apsolutno nikakvog dodatnog ulaganja .\r\nMogucnost prevoza vozila na adresu kupca .\r\nMogucnost izdavanja probnih tablica u najkracem roku .\r\nMogucnost prodaje vozila na rate bez kamate .\r\nZa vise informacija nas kontaktirajte', '4/5', '1', '1582707275', '5 speed manual', 154999, 'J NOVA', 101, 'black', '03/2020', 'euro5', 'fwd', '[\"Airbags\",\"ABS\",\"Asr\",\"Esp\"]', 5, 'automatic');

