(2, 'Yamaha', 'enduro', 'fz6', 600, 60, 4, 'liquid', 'chain', 4101, 5000, 1998, 'red', 'without', '[\"1582634114\\/00db1429b2ee634de78f89c2bfd466a1.jpeg\",\"1582634114\\/4b8a6b32dd1b4c94d1a082327ad64197.jpeg\",\"1582634114\\/be02d296839e32dfccba7b54662ca346.jpeg\",\"1582634114\\/d9642e40fc0a1c7a0be1e13719effa5a.jpeg\",\"1582634114\\/48335216ed80aff56ac85eb6d0d85c0c.jpeg\",\"1582634114\\/ba02cf52e94b4ea22ddecbe746e97a87.jpeg\",\"1582634114\\/f782f8bed06b48056bd117c6f8e5e16d.jpeg\",\"1582634114\\/e94c61d95b6162df2df97f562f397c39.jpeg\",\"1582634114\\/d6f4106864ddbbe2563cb3a90bfcbbbb.jpeg\"]', '[\"ABS\"]', 'Motor prosle godine uvezen iz Svajcarske.Servis uradjen pre 500 km( Motul 7100),stavljene nove gume i napred i nazad(Metzeler Interact),vlasnik,registovan godinu dana,poseduje i fabricki izduv.Prodaje se zbog nedostatka vremena za uzivanje.Bez centa ulaganja....Moguca zamena za gradjevinski materijal... panele...fasaderske radove... itd...cena u zameni 4600eur...', 1, '1582634114'),
(3, 'Yamaha', 'enduro', 'fz6', 600, 60, 4, 'liquid', 'chain', 4000, 5000, 1998, 'red', 'without', '[\"1582634147\\/7520f3aa6bd9f69465fd3cd14d9aa9d6.jpeg\",\"1582634147\\/24c2dfb1baa0ed3595662d5352f2e8c3.jpeg\",\"1582634147\\/21273d38da6d16e0094faa702334ecd2.jpeg\",\"1582634147\\/341ae5c7948e07db813efaaeb820c238.jpeg\",\"1582634147\\/29e4eb30df8a1981dec6d07efa0fb94b.jpeg\",\"1582634147\\/62ea1959b29b1e91c4ac58fb589a1c70.jpeg\",\"1582634147\\/ba9dc7527d4a6b362c1ad5bc1ec94ac6.jpeg\",\"1582634147\\/466c6fd85ac5d4b03963b12e56fc3fcc.jpeg\",\"1582634147\\/d4299a58a129471824cdf8988b8462fb.jpeg\",\"1582634147\\/1ce8f64c0096ec826e0de361d7ec39be.jpeg\",\"1582634147\\/b2c85645abbf68878417ca2255cb66f4.jpeg\"]', '[\"ABS\"]', 'Motor prosle godine uvezen iz Svajcarske.Servis uradjen pre 500 km( Motul 7100),stavljene nove gume i napred i nazad(Metzeler Interact),vlasnik,registovan godinu dana,poseduje i fabricki izduv.Prodaje se zbog nedostatka vremena za uzivanje.Bez centa ulaganja....Moguca zamena za gradjevinski materijal... panele...fasaderske radove... itd...cena u zameni 4600eur...', 1, '1582634147'),
(4, 'Ducati', 'Sport', 'SUPERSPORT 939 S', 937, 108, 4, 'liquid', 'chain', 13200, 5000, 2017, 'white', '03/2020', '[\"1582637992\\/d0008c622aefcdc05ecf8cdea21deeee.jpeg\",\"1582637992\\/61ae7c918cec0640ae6c4732840b5184.jpeg\",\"1582637992\\/2756418970c6a0dc3316bca00d0487c7.jpeg\",\"1582637992\\/3d9904426338fc2fd13012262c60c112.jpeg\",\"1582637992\\/e6e9ad80bc39c174018a1552a5a7182c.jpeg\",\"1582637992\\/109b15f27fbb02f67edfe45eefb05152.jpeg\"]', '[\"ABS\",\"Navigation\",\"Wind shield\"]', 'Prodaje se Ducati SUPERSPORT S, 2017-to godiste presao 5.000km.\r\nMotor je registrovan do 11.2020.\r\nMotor se vodi na Burnout tako da je kupac oslobodjen placanja poreza na prenos.\r\nZa kupce iz inostranstva cena bez PDV-a je 11.000 eur.\r\n\r\nMoguca zamena za maxi scooter!\r\n\r\nMotor je moguce pogledati u Ducati salonu na Novom Beogradu.\r\n\r\nSigurnosna Oprema: ABS, Ducati Traction Control, Riding Mode\r\nStandardna Opema: Power Mode, Ride by wire, Ducati Quick Shift, prekrivka zadnjeg sedišta\r\nPredispozicija: Za alarmni sistem, Grejače ručica, Ducati Multimedia System, Navigaciju\r\n\r\nAgregat: Ducati Testastretta 11˚ – Desmodromic, Dvocilindrični u L, 4 ventila po cilindru, Mono Spark, vodeno hlađenje\r\nZapremina: 937 cc\r\nSnaga: 110 Ks (81 Kw) na 9.000 obrtaja/min\r\nObrtni Momenat: 9,5 kgm (93 Nm) na 6.500 obrtaja/min\r\nUbrizgavanje: Elektronsko ubrizgavanje, Elipsasto kućipte leptir gasa Ø 53mm sa full sistemom Ride-by-Wire\r\nIzduv: Slip-on od nerđajućeg čelika sa duplim završetkom i aluminijumskom oblogom, dupla lambda sonda, katalizator\r\nMenjač: 6 brzina sa Ducati Quick Shift (DQS) up/down\r\nKvačilo: Višelamelno u ulju sa mehaničkom komandom i anti-hopping funkcijom\r\nRam: Cevasti čelični Trellis pričvrščen za glave motora\r\nPrednje Ogibljenje: Öhlins USD vila 48 mm u potpunosti podesiva\r\nZadnje Ogibljenje: Progresivno sa potpuno podesivim mono amortizerom Öhlins, Aluminijumska mono viljuška\r\nHod ogibljenja (pred/zad): 130 mm – 144 mm\r\nPrednja kočnica: 2 poluplivajuća diska od 320 mm, Klešta Brembo monoblok radijalno postavljena sa 4 klipa, Radijalna pumpa, ABS serijski\r\nZadnja kočnica Disk od 245 mm, Dvoklipna plivajuća klešta, serijski ABS\r\nInstrument Tabla: LCD\r\nTežina Bez Tečnosti:184 kg\r\nTežina (KERB): 210 kg\r\nVisina sedišta: 810 mm\r\nZapremina Rezervoara: 16 l\r\nBroj sedišta; Dva', 1, '1582637992'),
(5, 'Yamaha', 'Naked', 'MT 125', 124, 15, 1, 'air respirated', 'chain', 4950, 100, 2019, 'black', 'without', '[\"1582638203\\/3027104b2f2b2b6fea644d865a6e9a2b.jpeg\",\"1582638203\\/90de752e98cef0353898d2a47f1c381d.jpeg\",\"1582638203\\/b71dea32673f7a5197e80a8d55504252.jpeg\",\"1582638203\\/f5cd4a9787c890c6b6223321c644111c.jpeg\",\"1582638203\\/17c967bfed4c8dbb9e04a52dc97ca789.jpeg\",\"1582638203\\/56aa7fcb52a2f4356efb43f0d76d7cce.jpeg\",\"1582638203\\/b06d23bda0741b93c9d1ef666106e1eb.jpeg\",\"1582638203\\/ea9f5ae5fac05982301f1e29687b1237.jpeg\",\"1582638203\\/301f5b724be153241e6fbd5f24690f9d.jpeg\",\"1582638203\\/3ccea23ce9d67ff280c79c13e8b93ee1.jpeg\",\"1582638203\\/011dc02914fb00c49fe8185a394dd925.jpeg\",\"1582638203\\/df5f612aa8b6a4c921d82e9787072fcd.jpeg\",\"1582638203\\/d334bf741e3c2a47143a0c202dbdf6b5.jpeg\",\"1582638203\\/ec4745febdb2ee2faf7918d0d6242bc6.jpeg\",\"1582638203\\/50fc0b599e718b2be56a5965b06bd9df.jpeg\",\"1582638203\\/7433c4c392dbbdb5f895873676ca3ce3.jpeg\",\"1582638203\\/960b059aae698e3cfa04edac7acc33e7.jpeg\",\"1582638203\\/ce8bc862bf0b9c192fed380b251ce5ba.jpeg\",\"1582638203\\/dac6de277a7dc7e7c9badde69ace9514.jpeg\",\"1582638203\\/bb32ede0d4719d3b1a44b1e7b63236e6.jpeg\",\"1582638203\\/d182335d7d2fa34109dfd719f8039d27.jpeg\",\"1582638203\\/a3ca11680399a5ce5bf54f389f45e851.jpeg\",\"1582638203\\/418f8d531bcd7f796a75bbc4a4103a36.jpeg\",\"1582638203\\/32770c22a6651b9428c9963772592073.jpeg\",\"1582638203\\/06cd62f9981baef31561d9375c6c8b02.jpeg\",\"1582638203\\/ca43d9078e483c6f3d6c8254f07c2c59.jpeg\",\"1582638203\\/9952d29f3b298dae2de4e0cf54b09688.jpeg\",\"1582638203\\/3f14bc7205676c495ef6cd36cacdbd17.jpeg\",\"1582638203\\/c647e346b50a20d50dbfddfee8dc7dd8.jpeg\",\"1582638203\\/ab142138530d31127c33965438fae5cc.jpeg\",\"1582638203\\/4df0c6f6e182ae48f08dac4cf1595125.jpeg\",\"1582638203\\/c49ba34c6affab0652b9996208b65f1b.jpeg\"]', '[\"ABS\",\"Wind shield\"]', '*** Besplatna isporuka na teritoriji opštine Beograd i Novi Sad ***\r\n\r\nModel za ulazak u društvo velikih\r\n\r\nNova generacija Yamaha MT modela u potpunosti je protresla motociklistički svet. Sa skroz novim stilom, i ultra cool stavom, celokupna MT porodica predstavlja čisto iskustvo uživanja u vožnji. Još jedan novi MT je stigao – MT125!. Klasa od 125 cm³ više nikada neće biti ista!\r\n\r\nSa “naked” ramom odličnog izgleda ne postoji ništa slično novom MT-125 – ovo je “naked” fantastičnog izgleda. Sa karakterističnim “streetfighter” stilom koji izaziva pažnju gde god krenuli, ovaj motocikl ima ozbiljan stav. Svojom pojavom, veličinom i izgledom, najnoviji MT zaslužuje maksimalno poštovanje na ulici.\r\n\r\nSamo jednom ste mladi. Pobrinite se da MT-125 postane deo Vašeg života, i to sada, odmah.\r\n\r\nAgregat\r\nTip agregata 1 cilindar, hlađenje vodom, 4 takta, SOHC, 4 ventila\r\nZapremina 124.7 cm³\r\nPrečnik x hod 52.0 mm x 58.6 mm\r\nKompresioni odnos 11.2 : 1\r\nMaksimalna snaga 11.0 kW (15.0 KS) pri 9.000 o/min\r\nMaksimalan obrtni moment 12.4 Nm (1.25 kg-m) pri 8.000 o/min\r\nSistem podmazivanja Uljna pumpa\r\nNapajanje gorivom Elektronsko ubrizgavanje goriva\r\nTip spojnice Mokra, višelamelasta\r\nSistem paljenja TCI (digitalno)\r\nSistem pokretanja Električno\r\nSistem prenosa 6 brzina\r\nZavršni prenos Lanac\r\n\r\nŠasija\r\nRam Čelični Deltabox\r\nSistem prednjeg oslanjanja USD teleskopske viljuške Ø 41 mm\r\nHod oslanjanja napred 130 mm\r\nUgao prednje viljuške 25º\r\nPredtrag 89 mm\r\nSistem stražnjeg oslanjanja Monoshock, podešavanje predopterećenja opruge\r\nHod oslanjanja pozadi 114 mm\r\nPrednja kočnica Jednostruki disk, Ø 292 mm\r\nStražnja kočnica Jednostruki disk, Ø 230 mm\r\nPrednja guma 100/80-17 M/C\r\nStražnja guma 130/70-17 M/C\r\n\r\nDimenzije\r\nUkupna dužina 1.955 mm\r\nUkupna širina 740 mm\r\nUkupna visina 1.040 mm\r\nVisina sedišta 820 mm\r\nMeđuosovinski razmak 1.355 mm\r\nMinimalna udaljenost od tla 140 mm\r\nUkupna težina 138 kg\r\nKapacitet rezervoara goriva 11.5 litara\r\nKapacitet rezervoara ulja 1.15 litara\r\n\r\ndeta