(10, 'Ducati', 'Sport', 'SUPERSPORT 939 S', 937, 108, 4, 'liquid', 'chain', 13200, 5000, 2017, 'white', '03/2020', '[\"1582637992\\/d0008c622aefcdc05ecf8cdea21deeee.jpeg\",\"1582637992\\/61ae7c918cec0640ae6c4732840b5184.jpeg\",\"1582637992\\/2756418970c6a0dc3316bca00d0487c7.jpeg\",\"1582637992\\/3d9904426338fc2fd13012262c60c112.jpeg\",\"1582637992\\/e6e9ad80bc39c174018a1552a5a7182c.jpeg\",\"1582637992\\/109b15f27fbb02f67edfe45eefb05152.jpeg\"]', '[\"ABS\",\"Navigation\",\"Wind shield\"]', 'Prodaje se Ducati SUPERSPORT S, 2017-to godiste presao 5.000km.\r\nMotor je registrovan do 11.2020.\r\nMotor se vodi na Burnout tako da je kupac oslobodjen placanja poreza na prenos.\r\nZa kupce iz inostranstva cena bez PDV-a je 11.000 eur.\r\n\r\nMoguca zamena za maxi scooter!\r\n\r\nMotor je moguce pogledati u Ducati salonu na Novom Beogradu.\r\n\r\nSigurnosna Oprema: ABS, Ducati Traction Control, Riding Mode\r\nStandardna Opema: Power Mode, Ride by wire, Ducati Quick Shift, prekrivka zadnjeg sedišta\r\nPredispozicija: Za alarmni sistem, Grejače ručica, Ducati Multimedia System, Navigaciju\r\n\r\nAgregat: Ducati Testastretta 11˚ – Desmodromic, Dvocilindrični u L, 4 ventila po cilindru, Mono Spark, vodeno hlađenje\r\nZapremina: 937 cc\r\nSnaga: 110 Ks (81 Kw) na 9.000 obrtaja/min\r\nObrtni Momenat: 9,5 kgm (93 Nm) na 6.500 obrtaja/min\r\nUbrizgavanje: Elektronsko ubrizgavanje, Elipsasto kućipte leptir gasa Ø 53mm sa full sistemom Ride-by-Wire\r\nIzduv: Slip-on od nerđajućeg čelika sa duplim završetkom i aluminijumskom oblogom, dupla lambda sonda, katalizator\r\nMenjač: 6 brzina sa Ducati Quick Shift (DQS) up/down\r\nKvačilo: Višelamelno u ulju sa mehaničkom komandom i anti-hopping funkcijom\r\nRam: Cevasti čelični Trellis pričvrščen za glave motora\r\nPrednje Ogibljenje: Öhlins USD vila 48 mm u potpunosti podesiva\r\nZadnje Ogibljenje: Progresivno sa potpuno podesivim mono amortizerom Öhlins, Aluminijumska mono viljuška\r\nHod ogibljenja (pred/zad): 130 mm – 144 mm\r\nPrednja kočnica: 2 poluplivajuća diska od 320 mm, Klešta Brembo monoblok radijalno postavljena sa 4 klipa, Radijalna pumpa, ABS serijski\r\nZadnja kočnica Disk od 245 mm, Dvoklipna plivajuća klešta, serijski ABS\r\nInstrument Tabla: LCD\r\nTežina Bez Tečnosti:184 kg\r\nTežina (KERB): 210 kg\r\nVisina sedišta: 810 mm\r\nZapremina Rezervoara: 16 l\r\nBroj sedišta; Dva', 1, '1582637992'),
