(19, 'Indian', 'Chopper', 'Roadmaster', 1811, 79, 2, 'air respirated', 'chain', 32000, 0, 2020, 'green', 'without', '[\"1582643519\\/6885b3bf51cb0726bae6beb31c3326d0.jpeg\",\"1582643519\\/e4db6400161165386233ee91ffa9deba.jpeg\",\"1582643519\\/f8359fc11ac3b285a0e839c016cdbd5e.jpeg\",\"1582643519\\/d3aa937143a4ddc10840fdecbd519d28.jpeg\",\"1582643519\\/4245c1ced3b06f2da140b7c23cc0ae41.jpeg\",\"1582643519\\/746286e9615f6fcf5573b8a3d22e8b5e.jpeg\",\"1582643519\\/09d81ed3a7f84b8deddebfcf28ba67e0.jpeg\",\"1582643519\\/eb19e8d6698006170c1acda1473fd3f8.jpeg\",\"1582643519\\/9a7018d7611374030edfe4ae0ff9c2f6.jpeg\",\"1582643519\\/1336603a218295f959fcdf1d31b13677.jpeg\",\"1582643519\\/a40642646e9fd5eb994ec787706fece6.jpeg\",\"1582643519\\/9b04eced6a79e7b1478d208047bb257b.jpeg\"]', '[\"ABS\",\"Navigation\",\"Wind shield\",\"Helmet\"]', 'Ako ste ljubitelj čistokrvnih Američkih touring motocikala Indian Roadmaster je pravi izbor.\r\nSpoj tradicionalnog i modernog sa bogatim paketom opreme : 7\" touchscreen ekranom, 100w premium audio sistemom, ABS-om, kožnim sedištima, velikim prtljažnim prostorom,grejačima ručki i sedišta,električnim vetrobranom,led svetlima .....Vozilo maksimalne stabilnosti, upravljivosti i kontrole.\r\n\r\nROADMASTER 2019.\r\nThunder Black 32.890 EURA\r\nBurgundy Metallic 32.890 EURA\r\nPolished Bronze/Thunder Black 33.990 EURA\r\nPearl White/Star Silver 33.990 EURA\r\nSteel Gray Smoke/Thunder Black Smoke 33.990 EURA', 1, '1582643519'),
