(25, 'Honda', 'Enduro', 'cbx500', 471, 48, 2, 'liquid', 'chain', 5200, 18000, 2016, 'red', '03/2020', '[\"1582706455\\/9814885acbb94e0b688ec3dc3a07fa06.jpeg\",\"1582706455\\/4451937d4b3323ccb29f574da804ce11.jpeg\",\"1582706455\\/5e58c8a1dbb0b641c20d7df95810cd12.jpeg\",\"1582706455\\/aa3b44ee57e71b3e676789fb549f7952.jpeg\",\"1582706455\\/3ac786861383d07f426e543957fee2e8.jpeg\",\"1582706455\\/27c52c02f952f9dea678f8b6cbe35359.jpeg\",\"1582706455\\/db9954ad2286b8a1464106222d7466bb.jpeg\",\"1582706455\\/af8237c508ea80f804097e004e5f56a1.jpeg\",\"1582706455\\/366de700025746fd91dbf2b35257f80e.jpeg\",\"1582706455\\/f47bdde0a5eddc9ada4b9ccebb8229a3.jpeg\",\"1582706455\\/f2ea14e28e713af92517d0e2f5310126.jpeg\",\"1582706455\\/49e4d320669496a5a798e8a8af3d6302.jpeg\"]', '[\"ABS\",\"Wind shield\",\"Helmet\"]', 'Honda CB500X. Drugi vlasnik. Kupljen u Srbiji. Nove gume presle 1000 km. Zamenjeno ulje pre 1000 km. Vozi se sa A2 kategorijom. Uz motor idu i bocni koferi Givi. Prodaje se jer sam kupio veci motor. Vodi se na mene.', 1, '1582706455'),
(26, 'Yamaha', 'Scooter', 'x max', 292, 27, 1, 'liquid', 'chain', 5600, 0, 2020, 'yellow', 'without', '[\"1582706664\\/fff64d9651398c47dedd57d65d5c960c.jpeg\",\"1582706664\\/d1eebb5f12e4cad81dc450fdece965cc.jpeg\",\"1582706664\\/f3fd2efbb13b846e2fc36a849b6d2b1d.jpeg\",\"1582706664\\/e660fd54b5ed9cc513bcc892d36bde4e.jpeg\",\"1582706664\\/5841846d80ccb1cf943d172cc440c630.jpeg\",\"1582706664\\/d6d2cbfd16844e4f927c8d172f2f3217.jpeg\",\"1582706664\\/a98f1777f9a457fc9207b717e3c2ffea.jpeg\",\"1582706664\\/b3e1c40d9297599873c6f1bbcc230614.jpeg\",\"1582706664\\/e2404269d723be212bef23170b05c724.jpeg\"]', '[\"Wind shield\",\"Helmet\"]', 'Yamaha i Barel Vam predstavljaju X MAX 300\r\n\r\nMogućnost kupovine na kredit!!!\r\nIsporuka na adresu kupca\r\n\r\nSvi pokušavamo pravilno uravnotežiti posao i život. X-MAX 300 može olakšati i pojednostaviti svakodnevicu i učiniti je ugodnijom.\r\n\r\nKompaktni okvir opremljen je motociklističkim prednjim viljuškama i velikim točkovima i pruža okretno sportsko rukovanje sa udobnošću poslovne klase – a snažan i efikasan agregat Blue Core ima sve potrebne performanse za brzo putovanje na posao ili vožnje vikendom.\r\n\r\nSportski oklop izrađen je pomoću čistog DNK modela MAX i daje dinamičan izgled – a zahvaljujući velikom prostoru ispod sedišta za dve full face kacige i dodatnih stvari te standardno ugrađenim sistemom ABS i sistemom protiv proklizavanja (TCS), model X-MAX 300 ima sve što trebate: MAKSIMALNU zabavu i MAKSIMALNU praktičnost.\r\n\r\nDetalji :\r\nSportski i dinamičan dizajn sa čistim DNK modela TMAX\r\nAgregat Blue Core osigurava performanse i ekonomičnost\r\nMotociklističko prednje ogibljenje za povećanje stabilnosti\r\nSistem ABS kao standard\r\nSistem kontrole protiv proklizavanja (TCS) za sigurnu vožnju\r\nSistem paljenja bez ključa Smart Key\r\nUpečatljiva i moderna prednja i zadnja LED svetla\r\nYamaha Barel , Yamaha Srbija\r\nProstor ispod sedišta za 2 integralne kacige i dodatne stvari\r\nVišefunkcijska instrument tabla sa kontrolnim prekidačima\r\nUtičnica od 12V za napajanje i punjenje vaših uređaja\r\nVeliki točkovi osiguravaju sportsko upravljanje i stabilnost\r\nPrednje i zadnje disk kočnice sa standardnim ABS sistemom\r\nSedište i zavrsna obrada vrhunskog kvaliteta\r\n\r\nBAREL d.o.o. već 16 godina ovlašćeni je diler za prodaju motocikala i drugih proizvoda marke YAMAHA na teritoriji R. Srbije , ovlašćeni diler za prodaju originalnih YAMAHA rezervnih delova kao i ovlašćeni YAMAHA serviser - Yamaha motori, Yamaha skuteri, Yamaha ATV, Yamaha vanbrodski motori, Yamaha skuteri za vodu, Yamaha Srbija.\r\nKompletnu ponudu sa detaljnim opisom i bojama dostupnih modela Yamahe za 2020. pogledajte na nasem sajtu www.yamaha-barel.com\r\nHvala Vam na ukazanom poverenju.', 1, '1582706664');

